window.onload = function init()
{
    canvas = document.getElementById( "gl-canvas" );
    
    gl = WebGLUtils.setupWebGL( canvas );
    if ( !gl ) { alert( "WebGL isn't available" ); }
    
    //
    //  Initialize our data
    //
    
    readVertices();
    readFaces();
    
    canvas.onmousedown = handleMouseDown;
    document.onmouseup = handleMouseUp;
    document.onmousemove = handleMouseMove;
    
    //
    // Configure WebGL
    //
    gl.viewport( 0, 0, canvas.width, canvas.height );
    gl.clearColor( 1.0, 1.0, 1.0, 1.0 );
    
    // Enable hidden-surface removal
    
    gl.enable(gl.DEPTH_TEST);
    
    // Load shaders and initialize attribute buffers
    
    var program = initShaders( gl, "vertex-shader", "fragment-shader" );
    gl.useProgram( program );
    
    // Create a buffer object, initialize it, and associate it with the
    //   associated attribute variable in our vertex shader
    
    var vBuffer = gl.createBuffer();
    gl.bindBuffer( gl.ARRAY_BUFFER, vBuffer );
    gl.bufferData( gl.ARRAY_BUFFER, flatten(points), gl.STATIC_DRAW );
    
    var vPosition = gl.getAttribLocation( program, "vPosition" );
    gl.vertexAttribPointer( vPosition, 3, gl.FLOAT, false, 0, 0 );
    gl.enableVertexAttribArray( vPosition );
    
    matrixLoc = gl.getUniformLocation(program, "matrix");
    

    
    rotateZ(0);
    rotateX(0);
    rotateY(0);
    translate(0, -0.25, 0);
    
//    finalizeRotation();

    
    
    render();
};





/* TRANSLATION */
function translate(x, y, z) {
    position[0] += x;
    position[1] += y;
    position[2] += z;
    
    var newTranslation = [
                          vec4(  1,  0,  0,  x ),
                          vec4(  0,  1,  0,  y ),
                          vec4(  0,  0,  1,  z ),
                          vec4(  0,  0,  0,  1 )
                          ];
    
    translation = times(newTranslation, translation);
}

/* TRANSLATION */


/* ROTATION */
function rotateZ(a) {
    psi += a;
    var c = Math.cos(psi);
    var s = Math.sin(psi);
    
    rotationz = [
                 vec4(  c, -s,  0,  0 ),
                 vec4(  s,  c,  0,  0 ),
                 vec4(  0,  0,  1,  0 ),
                 vec4(  0,  0,  0,  1 )
                 ];
    
    hasToUpdateRotation = true;
}

function rotateX(a) {
    theta += a;
    var c = Math.cos(theta);
    var s = Math.sin(theta);
    
    rotationx = [
                 vec4(  1,  0,  0,  0 ),
                 vec4(  0,  c, -s,  0 ),
                 vec4(  0,  s,  c,  0 ),
                 vec4(  0,  0,  0,  1 )
                 ];
    
    hasToUpdateRotation = true;
}

function rotateY(a) {
    phi += a;
    var c = Math.cos(phi);
    var s = Math.sin(phi);
    
    rotationy = [
                 vec4(  c,  0,  s,  0 ),
                 vec4(  0,  1,  0,  0 ),
                 vec4( -s,  0,  c,  0 ),
                 vec4(  0,  0,  0,  1 )
                 ];
    
    hasToUpdateRotation = true;
}

function translateToOrigin() {
    return newT = [
                vec4(  1,  0,  0,  position[0] ),
                vec4(  0,  1,  0,  position[1] ),
                vec4(  0,  0,  1,  position[2] ),
                vec4(  0,  0,  0,  1 )
                ];
}

function translateFromOrigin() {
    return newT = [
                   vec4(  1,  0,  0,  -position[0] ),
                   vec4(  0,  1,  0,  -position[1] ),
                   vec4(  0,  0,  1,  -position[2] ),
                   vec4(  0,  0,  0,  1 )
                   ];
}

function finalizeRotation() {
    if (hasToUpdateRotation) {
        rotation = times(times(translateFromOrigin(), times(rotationy, times(rotationx, rotationz))), translateToOrigin());
        
        hasToUpdateRotation = false;
        hasToUpdateMatrix = true;
    }
}

function times(mat1, mat2) {
    var mat = mat4();
    
    for(var i = 0; i < 4; i++) {
        for(var j = 0; j < 4; j++) {
            mat[i][j] = mat1[i][0]*mat2[0][j] + mat1[i][1]*mat2[1][j] + mat1[i][2]*mat2[2][j] + mat1[i][3]*mat2[3][j];
        }
    }
    
    return mat;
}


function finalizeMatrix() {
    if (hasToUpdateMatrix) {
        matrix = times(translation, rotation);
        hasToUpdateMatrix = false;
    }
}

/* ROTATION */







/* CALLBACKS */

function handleMouseDown(event) {
    mouseDown = true;
    lastMouseX = event.clientX;
    lastMouseY = event.clientY;
}

function handleMouseUp(event) {
    mouseDown = false;
}

function handleMouseMove(event) {
    if (!mouseDown) {
        return;
    }
    
    var newX = event.clientX;
    var newY = event.clientY;
    
    var deltaX = newX - lastMouseX;
    var deltaY = newY - lastMouseY;
    
    rotateY(-deltaX/30);
    rotateX(-deltaY/30);
    
    lastMouseX = newX
    lastMouseY = newY;
}

