/* RENDERING */
function render()
{
    gl.clear( gl.COLOR_BUFFER_BIT | gl.DEPTH_BUFFER_BIT);
    
    finalizeRotation();
    finalizeMatrix();
    gl.uniformMatrix4fv(matrixLoc, false, flatten(matrix));
    
    gl.drawArrays( gl.TRIANGLES, 0, points.length );
    
    requestAnimFrame(render);
}

