function readVertices() {
    /* Skip the first four lines: */
    
//    # Blender v2.70 (sub 0) OBJ File: ''
//    # www.blender.org
//    mtllib bispo.mtl
//    o Line02
    for (var bla = 0; bla < 4; bla++) {
        while (objectCode.charAt(i) != '\n') i++;
        i++;
    }

    // Read each vertex
    while (objectCode.charAt(i) == 'v' && objectCode.charAt(i+1) != 'n') {
        i += 2;                     // Skip "v "
        var j;                      // Goes to the end of each number
        var vertex = vec3();        // Vertex that will be added
        
        // Read the x coordinate
        for (j = i; objectCode.charAt(j) != ' '; j++);          // Find where the number ends
        vertex[0] = parseFloat(objectCode.substr(i, j-1)) / 2;  // Add the coordinate to the new vertex
        
        // Read the y coordinate
        i = j + 1;                                              // Skip to the next number
        for (j = i; objectCode.charAt(j) != ' '; j++);
        vertex[1] = parseFloat(objectCode.substr(i, j-1)) / 2;

        // Read the z coordinate
        i = j + 1;
        for (j = i; objectCode.charAt(j) != '\n'; j++);
        vertex[2] = parseFloat(objectCode.substr(i, j-1)) / 2;

        i = j + 1;
        
        // Add the new vertex to the list
        vertices.push( vertex );
    }
    
}

function readFaces() {
    // Skip all the 'vn' lines
    while (objectCode.charAt(i) == 'v') {
        while (objectCode.charAt(i) != '\n') i++;
        i++;
    }
    
    /* Skip 2 more lines: */
//    usemtl wire_255255255
//    s off
    while (objectCode.charAt(i) != '\n') {
        i++;
    }
    i++;
    while (objectCode.charAt(i) != '\n') {
        i++;
    }
    i++;
    
    // Read each face
    while (objectCode.charAt(i) == 'f') {
        i += 2;                 // Skip the "f "
        var j;                  // Goes to the end of each number

        var number = [];        // Triangle to be added (indexes of three vertices in the vertex list)

        // First vertex
        for (j = i; objectCode.charAt(j) != '/'; j++);          // Read up to the first '/'
        number[0] = parseInt(objectCode.substr(i, j-1)) - 1;    // Add the number
        for (i = j; objectCode.charAt(i) != ' '; i++);          // Skip the rest
        i++;
        
        // Second vertex
        for (j = i; objectCode.charAt(j) != '/'; j++);
        number[1] = parseInt(objectCode.substr(i, j-1)) - 1;
        for (i = j; objectCode.charAt(i) != ' '; i++);
        i++;
        
        // Third vertex
        for (j = i; objectCode.charAt(j) != '/'; j++);
        number[2] = parseInt(objectCode.substr(i, j-1)) - 1;
        for (i = j; objectCode.charAt(i) != '\n'; i++);
        i++;

        // Add the vertices to the points array
        for (var k = 0; k < 3; k++)
            points.push(vertices[number[k]]);
    }

}

